import { Header, Title, Nav } from './styleComps';
import TagLink from '../../components/TagLink';

import HomeIcon from "./icons/home.svg";

function Home() {
    return (<>
        <Header>
            <Title>My Blog App</Title>
            <Nav>
                <TagLink text="Home" icon={HomeIcon} link="/" />
            </Nav>
            <img src={HomeIcon} alt=""/>
        </Header>
    </>)
}

export default Home;
